$("#btnSolution").click(function(){var n=JSON.parse(localStorage.mazesolution);printMaze(n)});$("#btnGenerate").click(function(){$("#textResult").text("");$.ajax({type:"GET",dataType:"json",url:"/Home/GenerateMaze",data:{width:$("#width").val(),height:$("#height").val()},success:function(n){if(n.errorMessage){$("#textResult").text(n.errorMessage);return}var t=n.maze;localStorage.mazesolution=JSON.stringify(n.solution);localStorage.maze=t;printMaze(t)},error:function(n,t,i){$("#textResult").text("Error - "+i)}})});printMaze=function(n){var t=$("#maze tbody");t.empty();$.each(n,function(i){for(var u=$("<tr>"),r=0;r<n[i].length;r++)$('<td class="td-height-10">').html(n[i][r]).appendTo(u);t.append(u)})};